// src/components/MusicService.js
import React, { useEffect } from 'react';
import axios from 'axios';

const MusicService = ({ service, setTrackList }) => {
  useEffect(() => {
    const fetchTracks = async () => {
      try {
        let tracks;
        if (service === 'apple') {
          // Placeholder for Apple Music API
          tracks = await axios.get('/apple-music-api-endpoint');
        } else if (service === 'spotify') {
          const token = 'BQA2Nut_pPIPOeh2h5445Ba4M3QJSCAgY14MLIKSuMcvYXG_V0mWyE9zfv1Q2eToRRZNkfNVHSuoIj_UXxWLt9tbm7t86BcWu0xAgjrTK0SzHeXnMN9OdIv6Ahy6oSAdu2CxRrNeVGB5fourOpUKyqbi3lvE53yKtPazosmGmJ73C1C2YG00JW4fMDGbt_Dy4VV25HaZjPfFO2hpIh2mBZyr-mGgtD2tTwTM0dA20N6amtcyMllqNIWAT3ZxBWXIys4sDSFsV-xaImQbhnB4nqaj';
          tracks = await axios.get('https://api.spotify.com/v1/me/top/tracks', {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          });
        }
        setTrackList(tracks.data.items);
      } catch (error) {
        console.error('Error fetching tracks:', error);
      }
    };

    if (service) {
      fetchTracks();
    }
  }, [service, setTrackList]);

  return <div>Loading...</div>;
};

export default MusicService;
